import { DialogService } from 'primeng/dynamicdialog';
import { NgModule } from '@angular/core';

import { SharedModule } from 'app/shared/shared.module';
import { AdminApprovalComponent } from './admin-approval.component';
import { AdminApprovalRoutingModule } from './admin-approval.routing';

import { ConfirmationService, MessageService } from 'primeng/api';

import { TabViewModule } from 'primeng/tabview';
import { TableModule } from 'primeng/table';
import { CheckboxModule } from 'primeng/checkbox';
import { ButtonModule } from 'primeng/button';
import { PublicHolidayApprovalComponent } from './public-holiday-approval/public-holiday-approval.component';
import { PayrollBlackOutApprovalComponent } from './payroll-black-out-approval/payroll-black-out-approval.component';
import { ParameterApprovalComponent } from './parameter-approval/parameter-approval.component';
import { PanelModule } from 'primeng/panel';
import { GroupService, RoleService } from 'app/admin/access-control';
import { MultiSelectModule } from 'primeng/multiselect';
import { ChipModule } from 'primeng/chip';
import { MessagesModule } from 'primeng/messages';
import { PayrollBlackOutApprovalService } from './payroll-black-out-approval/payroll-black-out-approval.service';
import { PublicHolidayApprovalService } from './public-holiday-approval/public-holiday-approval.service';
import { ParameterService } from '../parameter/service/parameter.service';
import { DropdownModule } from 'primeng/dropdown';
import { ConfirmPopupModule } from 'primeng/confirmpopup';
import { NspConfirmationService } from 'app/shared/confirm/nsp-confirm.service';

@NgModule({
  imports: [
    SharedModule,
    AdminApprovalRoutingModule,
    TabViewModule,
    TableModule,
    CheckboxModule,
    ButtonModule,
    PanelModule,
    MultiSelectModule,
    ChipModule,
    MessagesModule,
    DropdownModule,
    ConfirmPopupModule
    ],
  declarations: [
    AdminApprovalComponent,
    PublicHolidayApprovalComponent,
    PayrollBlackOutApprovalComponent,
    ParameterApprovalComponent],
  providers: [
    PayrollBlackOutApprovalService,
    PublicHolidayApprovalService,
    ParameterService,
    ConfirmationService,
    NspConfirmationService,
    MessageService, 
    RoleService, 
    GroupService,
    DialogService]
})
export class AdminApprovalModule {
}
